window.bookSummaryJSON = "<p>Jade isn’t your typical cloud-sitting, harp-playing kind of angel. <br> </p> <p>After discovering she’s actually an Archangel, Jade Blackwell has to become the fierce warrior she is meant to be. First, she must Ascend by surviving a variety of trials in a treacherous labyrinth. Only then will she regain all her memories and be given control of her gifts. And she’ll need both to become one of Heaven’s most elite and holy of fighters.<br> </p> <p>Hell is raising an army, and with the veil separating worlds now practically nonexistent, time is not on her side. Jade must look deep into her past to move forward, but she soon realizes that her life before dying and becoming a reaper is not the life she’d hope to find.<br> </p> <p>Beating the maze means facing her worst fears, her greatest weaknesses, and most importantly, the truth. At the end, Jade must leave everything behind and sacrifice the one thing her heart desires in order to truly win. But can she do it?<br> </p> <p>If she doesn’t succeed, there is no second chance. <br> </p> <p>Join thousands of listeners clamoring to get the third book in the Reaper Reborn series by grabbing your copy today!</p>"; 
